def lengthOfLongestSubstring(s):
    str_len=len(s)
    for i in range(0,str_len):
        window_size=str_len-i
        for j in range(0,i+1):
            sub_str=s[j:j+window_size]
            hasRepeating=False
            for k in range(0, len(sub_str)):
                if sub_str[k] in sub_str[k+1:]:
                    hasRepeating=True
                    break
            if not hasRepeating:
                return window_size
    return 0




def hasRepeating(sub_str):
    for i in range(0, len(sub_str)):
        if sub_str[i] in sub_str[i+1:]:
            return True
    return False



